import React,{Component,ChromeSamples} from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import './stylle.css'
import { Link,Redirect } from 'react-router-dom';
class Indexx extends React.Component{
    constructor(props){
        super(props);
        this.state=({
            source:'',
            source_url:'',
            destination:'',
            destination_url:''
        });
     }
      onch1=(event)=>{
          this.setState({
              source:event.target.value
          })
      }
      onch2=(event)=>{
          this.setState({
            source_url:event.target.value
          })
      }
      onch3=(event)=>{
          this.setState({
              destination:event.target.value
          })
      }
      onch4=(event)=>{
          this.setState({
            destination_url:event.target.value
          })
      }
      onsub=()=>{
        let source=this.state.source
        let source_url=this.state.source_url
        let destination=this.state.destination
        let destination_url=this.state.destination_url
        const datag = source+source_url+destination+destination_url
        postRequest('/userlist', {datag})
        .then(data => console.log(datag)) // Result from the `response.json()` call
         fetch('/userlist', {
            credentials: 'same-origin', // 'include', default: 'omit'
            method: 'POST',             // 'GET', 'PUT', 'DELETE', etc.
            body: JSON.stringify(data), // Use correct payload (matching 'Content-Type')
            headers: { 'Content-Type': 'application/json' },
        })
        .then(response => response.json())
        .catch(error => console.error(error))
     }
    render(){

        return(
            <div className="container" class="body">
                <h3>Stop Search Go</h3>
                <form action="" method="post" onSubmit={this.onsub} class="form" >
                    <br/>
                    <label><b>Source</b></label>
                    <select name="source" onChange={this.onch1} >
                        <option value="">-Select-</option>
                        <option value="Gsuite">Gsuite</option>
                        <option value="0365">0365</option>
                    </select>
                    <input type="text" name="source_url" placeholder="enter url" onChange={this.onch2} required/>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <label><b>Destination</b></label>
                    <select name="destination" onChange={this.onch3} >
                        <option value="">-Select-</option>
                        <option value="Gsuite">Gsuite</option>
                        <option value="0365">0365</option>
                    </select>
                    <input type="text" name="destination_url" placeholder="enter url" onChange={this.onch4} required/><br /><br />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
                    <button> View</button>
                        {/* <a href="/Userlist" className="btn btn-success">view List</a> */}
                    {/* <Link to="/Userlist" className="ml-auto">
                        <button> View</button>                    
                  </Link> */}
                </form>
             </div>

        );
    }
}

export default Indexx;
